INSERT INTO `post_reply` (`replyID`, `postID`, `userID`, `message`, `latitude`, `longitude`, `type`, `createdDate`, `deletedDate`) VALUES
	(1, 7, 'user3', '언제 출발하시나요?', '37.497942', '127.027621', 'taxi', '2015-01-14 09:00:00', NULL),
	(2, 7, 'user1', '10시쯤 출발할려구요. 괜찮으세요?', '37.498198608569275', '127.02953461557625', 'taxi', '2015-01-14 09:06:00', NULL),
	(3, 7, 'user3', '네 좋습니다. 강남역 어디서 보나요?', '37.497942', '127.027621', 'taxi', '2015-01-14 09:12:00', NULL),
	(4, 7, 'user1', '11번출구 10시 정각에 뵙죠. 도착하시면 여기 댓글 남겨 주세요.', '37.498198608569275', '127.02953461557625', 'taxi', '2015-01-14 09:14:00', NULL),
	(6, 7, 'user3', '네', '37.497942', '127.027621', 'taxi', '2015-01-14 09:28:00', NULL),
	(7, 19, 'user27', '합승해도 되나요? 저도 목동가는데..', '37.514072', '126.94167', 'taxi', '2015-01-18 13:13:00', NULL),
	(11, 19, 'user19', '네. 지금 출발하실수 있나요? 노량진삼거리역 6번출구 어때요?', '37.51259148306303', '126.93698029965162', 'taxi', '2015-01-18 13:14:48', NULL),
	(12, 19, 'user27', '네. 지금 바로 나갈께요.', '37.514072', '126.94167', 'taxi', '2015-01-18 13:15:36', NULL),
	(13, 43, 'user30', '저도 합승할께요. 출발하셨나요?', '37.49905884390194', '127.02748071402313', 'taxi', '2015-01-31 20:46:35', NULL),
	(14, 43, 'user4', '어, 강남역 근처이신가바요?', '37.49926711831331', '127.0289270952344', 'taxi', '2015-01-31 20:50:35', NULL),
	(15, 43, 'user30', '네. 11번출구 근처에요 ㅋ', '37.49905884390194', '127.02748071402313', 'taxi', '2015-01-31 20:52:35', NULL),
	(16, 43, 'user4', '그럼 거기서 뵐까요? 지금 나갈게요', '37.49926711831331', '127.0289270952344', 'taxi', '2015-01-31 20:53:35', NULL),
	(17, 43, 'user30', '네 11번 출구에서 있을께요. 흰색 잠바입니다. ^^', '37.49905884390194', '127.02748071402313', 'taxi', '2015-01-31 20:55:35', NULL),
	(18, 11, 'user2', '출발하셨나요?', '37.497591596721726', '127.02885769307615', 'taxi', '2015-01-14 00:38:25', NULL),
	(19, 11, 'user5', '네. 안타깝네요. 방금 출발했어요..', '37.552310017968736', '127.03671019524337', 'taxi', '2015-01-14 00:41:35', NULL),
	(20, 8, 'user2', '저도 수원가요. 같이 가도 되나요?', '37.49302262353604', '127.02720679342747', 'taxi', '2015-01-14 13:09:45', NULL),
	(21, 8, 'user32', '네 물론이죠. 우리 택시비 반땅해요~ ^^', '37.496271954029815', '127.02639274299143', 'taxi', '2015-01-14 14:09:55', NULL),
	(22, 8, 'user19', '저도 합승해도 되나요?', '37.49747216217077', '127.03127335757017', 'taxi', '2015-01-14 14:43:05', NULL),
	(23, 8, 'user32', '아 네네^^ 같이 가요~ 강남역 6번출구에서 7시에 볼까요?', '37.496271954029815', '127.02639274299143', 'taxi', '2015-01-14 14:58:56', NULL),
